	add("stability", "{\"term\":\"stability\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027stabilité\u0027 from Latin root of \u0027stabilitas\u0027 (lang\u003dla) from \u0027stabilis\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being stable or in equilibrium, and thus resistant to chang\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The tendency to recover from perturbations\", \"priority\":2}]}, \"synonyms\":{}}");

