	add("stabling", "{\"term\":\"stabling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A building, shed, or room for horses and cattle; a stable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1877\u0027\u0027, Chapter 22[http://en.wikisource.org/wiki/Black_Beauty/22\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There was a very fine house and a great deal of \u0027\u0027stabling\u0027\u0027; we went into the yard through a stone gateway, and John asked for Mr. York\", \"priority\":3}]}, \"synonyms\":{}}");

