	add("stack", "{\"term\":\"stack\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"English\", \"Icelandic\", \"old norse\", \"Swedish\"], \"text\":\"From Old norse \u0027stakkr\u0027 compare Icelandic \u0027stakkur\u0027 Swedish \u0027stacka\u0027 Danish \u0027stakke\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pile\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large pile of hay, grain, straw, or the like, larger at the bottom than the top, sometimes covered with thatch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1731-1800\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"But corn was housed, and beans were in the \u0027\u0027stack\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A pile of similar objects, each directly on top of the last\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A pile of poles or wood, indefinite in quantity\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1561-1626\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Against every pillar was a \u0027\u0027stack\u0027\u0027 of billets above a man\u0027s height\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A pile of wood containing 108 cubic cubic feet. (~3 m\u0026amp;sup3\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A smokestack\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"With just the turn of a shoulder she indicated the water front, where, at the end of the dock on which they stood, lay the good ship, \u0027Mount Vernon\u0027, river packet, the black smoke already pouring from her \u0027\u0027stacks\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In digital computing\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A linear data structure in which the last data item stored is the first retrieved; a LIFO queue\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A portion of computer memory occupied by a \u0027\u0027stack\u0027\u0027 data structure, particularly (\u0027\u0027the stack\u0027\u0027) that portion of main memory manipulated during machine language procedure call related instructions\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Michael A. Miller, \u0027The 68000 Microprocessor Family: Architecture, Programming, and Applications\u0027, p.47\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"When the microprocessor decodes the JSR opcode, it stores the operand into the TEMP register and pushes the current contents of the PC ($00 0128) onto the \u0027\u0027stack\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A generalization of schemes in algebraic geometry and of sheaves\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A coastal landform, consisting of a large vertical column of rock in the sea\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Compactly spaced bookshelves used to house large collections of books\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A large amount of an object\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A pile of rifles or muskets in a cone shape\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"The amount of money a player has on the table\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"In architecture\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A number of flues embodied in one structure, rising above the roof\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A vertical drainpipe\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"A fall or crash, a prang\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A blend of various dietary supplements or anabolic steroids with supposed synergistic benefits\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"At Caltech, a lock, obstacle, or puzzle designed to prevent underclassmen from entering a senior\u0027s room during ditch day\", \"priority\":28}]}, \"synonyms\":{}}");

	add("staccato", "{\"term\":\"staccato\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"old norse\", \"old saxon\"], \"text\":\"{{borrowing|it|lang\u003den}} {{m|it|staccato||detached, disconnected}}, past participle of {{m|it|staccare||to detach, separate}}, aphetic variant of {{m|it|distaccare||to separate, detach}} from Middle french (ca. 1400-1600) {{m|frm|destacher||to detach}} from Old french (842-ca. 1400) {{m|fro|destachier||to detach}} from {{prefix|des|atachier|t2\u003dto attach|lang\u003dfro|nocat\u003d1}}, alteration of {{m|fro|estachier||to fasten with or to a stake, lay claim to}} from {{m|fro|estache||a stake}}, from Low Frankish {{m|frk|*stakka||stake}}, from Proto-germanic {{m|gem-pro|*stakkaz}}, {{m|gem-pro|*stakkēn||stick, stake}}, from Proto-indo-european {{m|ine-pro|*(s)teg-||stick, stake}}. Akin to Old high german (ca. 750-1050) {{m|goh|stecko||post}} (German {{m|de|Stecken||stick}}), Old saxon {{m|osx|stekko||stake}}, Old norse {{m|non|stakkr||hay stack, heap}}, Old english (ca. 450-1100) {{m|ang|staca||stake}}. More at {{l|en|stake}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An articulation marking directing that a note or passage of notes are to be played in an abruptly disconnected manner, with each note sounding for a very short duration, and a short break lasting until the sounding of the next note; as opposed to legato. Staccato is indicated by a dot directly above or below the notehead\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A passage having this mark\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stache", "{\"term\":\"stache\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{clipping|moustache|nodot\u003d1|lang\u003den}} or {{m|en|mustache}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Moustache, mustache\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, \u0027\u0027, [http://www.nytimes.com/2003/07/28/arts/television/28TEEN.html \u0026quot;Don\u0027t Wanna Grow Up Cuz Puberty Isn\u0027t Funny\u0026quot;], July 28, 2003\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Only one show has succeeded in keeping a kid in the lead for a decade: \u0026quot;The Simpsons\u0026quot; with the animated Bart Simpson. Watching Bart never mature is considered a key to its enduring appeal. \u0026quot;Early on, I know that the powers that be decided that no one would age,\u0026quot; said Tim Long, the show\u0027s current head writer. \u0026quot;A kid with a starter \u0027\u0027‘stache\u0027\u0027, that would just be unpleasant,\u0026quot; he added\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027\u0027, [http://www.nytimes.com/2005/05/23/nyregion/metrocampaigns/23campaign.html \u0026quot;Democrats Still Searching for a Stronger Challenger\u0026quot;], May 23, 2005\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The candidate] may face an entirely different challenge in his quest for the mayoralty: his mustache. [...] The perils of the \u0027\u0027‘stache\u0027\u0027 may be hard to define, but analysts say that looks matter in politics, where facial hair is frequently considered verboten\", \"priority\":5}]}, \"synonyms\":{}}");

	add("stackyard", "{\"term\":\"stackyard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stack|yard|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A farmyard in which stacks of hay etc. are stored\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stacte", "{\"term\":\"stacte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Latin {{lena}}, from Ancient greek (to 1453) \u0027στακτή\u0027 (oil of myrrh) from \u0027στακτός\u0027 (oozing out in drops)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the sweet spices used by the ancient Jews in preparing incense; possibly an oil or other form of myrrh or cinnamon, or a kind of storax\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And the Lord said to Moses: Take unto thee spices, \u0027\u0027stacte\u0027\u0027, and onycha, galbanum of sweet savour, and the clearest frankincense, all shall be of equal weight.\u0027 Exodus 30:34, Douay-Rheims-Challoner translation\", \"priority\":2}]}, \"synonyms\":{}}");

	add("staddle", "{\"term\":\"staddle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"Icelandic\"], \"text\":\"From Middle english (1100-1500) \u0027stathel\u0027 from Old english (ca. 450-1100) \u0027staþol\u0027 (foundation, base, support, position, site, estate) from Proto-germanic {{m|gem-pro|*staþulaz||position, standing}}, from Proto-indo-european {{m|ine-pro|*steh₂-}}, {{m|ine-pro|*sth₂-||to stand}}. Cognate with Middle low german \u0027stadel\u0027 (barn) German \u0027stadel\u0027 (ground, croft, stall, shed) Old Danish \u0027stedel\u0027 (ground, croft) Icelandic \u0027stöðull\u0027 (position) More at {{l|en|stand}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A prop or support; a staff, crutch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The lower part or supporting frame of a stack, a stack-stand\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any supporting framework or base\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A small tree; sapling\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the separate plots into which a coc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"cock of hay is shaken out for the purpose of drying\", \"priority\":6}]}, \"synonyms\":{}}");

	add("stadia", "{\"term\":\"stadia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|200px|A surveyors\u0027 stadia or level staff\u0027\u0027stadia\u0027\u0027 \u0027\u0026amp\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A level staff or levelling rod used by surveyors to measure differences in level, or to measure horizontal distances by sighting the stadia hairs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A graduated brass triangle used to measure the distance of a target by comparison of the graduations with the heights of soldiers or horses\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stadium", "{\"term\":\"stadium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027stadium|lang\u003dla\u0027 () (commonly one-eighth of a Roman mile; translated in early English Bibles by furlong), from Ancient greek (to 1453) \u0027στάδιον\u0027 (a measure of length, a running track) especially the track at Olympia, which was one stadium in length. The Greek word may literally mean \u0026quot;fixed standard of length\u0026quot; (from \u0027στάδιος\u0027 (firm, fixed) from Proto-indo-european {{m|ine-pro|*sta-}}, whence also \u0027stand\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A venue where sporting events are held\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 June 18, \u0026quot;[http://www.nytimes.com/2013/06/19/world/americas/brazilian-leaders-brace-for-more-protests.html Protests Widen as Brazilians Chide Leaders],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 21 June 2013)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In a convulsion that has caught many in Brazil and beyond by surprise, waves of protesters denounced their leaders for dedicating so many resources to cultivating Brazil’s global image by building \u0027\u0027stadiums\u0027\u0027 for international events, when basic services like education and health care remain woefully inadequate\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An ancient Greek race course, especially, the Olympic course for foot races\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A Greek measure of length, being the chief one used for itinerary distances, also adopted by the Romans for nautical and astronomical measurements, equal to 600 Greek or 625 Roman feet, or 125 Roman paces, or to 606 feet, 9 inches\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"II.ii.3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Dionysiodorussent a letter \u0027ad superos\u0027 after he was dead, from the centre of the earth, to signify what distance the same centre was from the superficies of the same, viz. 42,000 \u0027\u0027stadiums\u0027\u0027\u0026amp;nbsp;[…\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A kind of telemeter for measuring the distance of an object of known dimensions, by observing the angle it subtends\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In surveying, a graduated rod used to measure the distance of the place where it stands from an instrument having a telescope, by observing the number of the graduations of the rod that are seen between certain parallel wires (stadia wires) in the field of view of the telescope\", \"priority\":9}]}, \"synonyms\":{}}");

	add("stadtholdership", "{\"term\":\"stadtholdership\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stadtholder|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The office or rank of a stadtholder\", \"priority\":1}]}, \"synonyms\":{}}");

	add("staff", "{\"term\":\"staff\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|staf}}, from Old english (ca. 450-1100) \u0027stæf\u0027 from Proto-germanic {{m|gem-pro|*stabaz}}. Cognate with Dutch \u0027staf\u0027 German \u0027stab\u0027 Swedish \u0027stav\u0027 Sense of \u0026quot;group of military officers that assists a commander\u0026quot;, attested from 1702, is influenced from German \u0027stab\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|A musical staf\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A long, straight stick, especially one used to assist in walking\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A series of horizontal lines on which musical notes are written\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The employees of a business\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mixture of plaster and fibre used as a temporary exterior wall covering.\u0026lt;sup\u0026gt;w:Staff (building W\u0026lt;/sup\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A pole, stick, or wand borne as an ensign of authority; a badge of office\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Methought this \u0027\u0027staff\u0027\u0027, mine office badge in court, / Was broke in twain\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Sir (c.1564-1627\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"All his officers brake their \u0027\u0027staves\u0027\u0027; but at their return new \u0027\u0027staves\u0027\u0027 were delivered unto them\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A pole upon which a flag is supported and displayed\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The rung of a ladder\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Dr. J. Campbell (E. Brown\u0027s Travels\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"I ascend at one [ladder] of six hundred and thirty-nine \u0027\u0027staves\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A series of verses so disposed that, when it is concluded, the same order begins again; a stanza; a stave\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1631-1700\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Cowley found out that no kind of \u0027\u0027staff\u0027\u0027 is proper for an heroic poem, as being all too lyrical\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"An arbor, as of a wheel or a pinion of a watch\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The grooved director for the gorget, or knife, used in cutting for stone in the bladder\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An establishment of officers in various departments attached to an army, to a section of an army, or to the commander of an army. The general\u0027s staff consists of those officers about his person who are employed in carrying his commands into execution\", \"priority\":20}]}, \"synonyms\":{}}");

	add("stage", "{\"term\":\"stage\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|steh₂}}From Middle english (1100-1500) {{m|enm|stage}}, from Old french (842-ca. 1400) \u0027estage\u0027 (lang\u003dfro) from \u0027*stāticum\u0027 (standing-place) from Latin {{m|la|stāre||to stand}}. Cognate with Old english (ca. 450-1100) {{m|ang|stæde}}, \u0027stede\u0027 (state, status, standing, place) More at {{l|en|stead}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A phase\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1800-1859\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Such a polity is suited only to a particular \u0027\u0027stage\u0027\u0027 in the progress of society\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic\u0026amp;nbsp;[\u0026amp;hellip;].\u0026amp;nbsp; Until 2008 there was denial over what finance had become.\u0026amp;nbsp;[\u0026amp;hellip;]\u0026amp;nbsp; But the scandals kept coming, and so we entered \u0027\u0027stage\u0027\u0027 three – what therapists call \u0026quot;bargaining\u0026quot;. A broad section of the political class now recognises the need for change but remains unable to see the necessity of a fundamental overhaul. Instead it offers fixes and patches\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A platform, generally elevated, upon which show performances or other public events are given\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1688-1744\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Knights, squires, and steeds must enter on the \u0027\u0027stage\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1791–1875\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Lo! Where the \u0027\u0027stage\u0027\u0027, the poor, degraded stage, / Holds its warped mirror to a gaping age\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A floor or storey of a house\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A floor elevated for the convenience of mechanical work, etc.; scaffolding; staging\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A platform, often floating, serving as a kind of wharf\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A stagecoach, an enclosed horsedrawn carriage used to carry passengers\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1731-1800\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"a parcel sent you by the \u0027\u0027stage\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1667–1745\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"I went in the sixpenny \u0027\u0027stage\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A place of rest on a regularly travelled road; a station; a place appointed for a relay of horses\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A degree of advancement in a journey; one of several portions into which a road or course is marked off; the distance between two places of rest on a road\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Jeffre\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027stage\u0027\u0027 signifies a certain distance on a road\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"1858\u0027\u0027, , \u0027[http://books.google.com.au/books?id\u003dPKOV67lbNMAC The Life of George Stephenson: Railway Engineer]\u0027, p.35\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"He travelled by gig, with his wife, his favourite horse performing the journey by easy \u0027\u0027stages\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.gutenberg.org/ebooks/11593 The Purchase chapter\u003d3|passage\u003dThe \u0027Mount Vernon\u0027, favoured by a good stage of water, soon cleared the narrow Monongahela channel, passed the confluence, and headed down under full steam,\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The number of an electronic circuit’s block, such as a filter, an amplifier, etc\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"The place on a microscope where the slide is located for viewing\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A level; one of the sequential areas making up the game\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"A place where anything is publicly exhibited, or a remarkable affair occurs; the scene\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"When we are born, we cry that we are come / To this \u0027\u0027stage\u0027\u0027 of fools\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Music and ethereal mirth / Wherewith the \u0027\u0027stage\u0027\u0027 of air and earth did ring\", \"priority\":32}]}, \"synonyms\":{}}");

	add("stagehand", "{\"term\":\"stagehand\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stage|hand|tr2\u003dmanual worker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who works behind the scenes at a theatre or in other theatrical media\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The actors get the glory, the spotlight and the name up in lights while it is the \u0027\u0027stagehands\u0027\u0027 who point the spotlight, hang the name and change the light bulbs\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stageplayer", "{\"term\":\"stageplayer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stage|player|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An actor on the stage\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stager", "{\"term\":\"stager\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An actor on the stage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who stages a theatrical performance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Richard Beadle, \u0027The Cambridge Companion to Medieval English Theatre\u0027 (page 271\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Here the principal \u0027\u0027stagers\u0027\u0027 of saints\u0027 plays appear to have been the civic authorities, and guilds or confreries, and the popularity of this type of drama owed much to the cult of saint\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One who has long acted on the stage of life; a practitioner; a person of experience, or of skill derived from long experience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A horse used in drawing a stage\", \"priority\":6}]}, \"synonyms\":{}}");

	add("stagflation", "{\"term\":\"stagflation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|stagnation|inflation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inflation accompanied by stagnant growth, unemployment or recession\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stagger", "{\"term\":\"stagger\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old norse\"], \"text\":\"From Old norse \u0027stakra\u0027 (\u0027to push\u0027)\u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?term\u003dstagger Etymology] in :w:Online Etymology Dictionary|Online Etymology Dictionary\u0026lt;/ref\u0026gt;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Sprint Car Stagger Plymouth Dirt Track thumb|right|Tire stagge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An unsteady movement of the body in walking or standing, as if one were about to fall; a reeling motion; vertigo; -- often in the plural; as, the stagger of a drunken man\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A disease of horses and other animals, attended by reeling, unsteady gait or sudden falling; as, parasitic staggers; apoplectic or sleepy staggers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bewilderment; perplexity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In motorsport, the difference in circumference between the left and right tires on a racing vehicle. It is used on oval tracks to make the car turn better in the corners.\u0026lt;ref\u0026gt;[http://www.stockcarracing.com/techarticles/scrp_0805_tire_stagger/ Stock Car Racing magazine article on stagger], February 2009 \u0026lt;/ref\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

	add("staghorn", "{\"term\":\"staghorn\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stag|horn|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The antlers of a stag when used to make handles etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("staghound", "{\"term\":\"staghound\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|stag|hound|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several large dogs once bred to hunt stags\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027, Sir Arthur Conan Doyle, \u0027A Study in Scarlet\u0027, VII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Woodwork and glass gave way before him; but before he got quite through, Gregson, Lestrade, and Holmes sprang upon him like so many \u0027\u0027staghounds\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stagione", "{\"term\":\"stagione\", \"etymology\":{\"influencers\":[], \"languages\":[\"Italian\", \"Latin\"], \"text\":\"From Latin \u0027stātiōnem\u0027 the accusative singular of \u0027stātiō\u0027 Cognate to \u0027stazione\u0027 which is from the same Latin word but borrowed instead of inherited. Also a doublet of {{m|it|stazzo}} and {{m|it|stazzone}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system for presenting opera, whereby each production is cast separately and has a brief but intensive run of performances\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stagirite", "{\"term\":\"stagirite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Latin \u0027stagirites\u0027 from the Ancient greek (to 1453) \u0027σταγιριτης\u0027 (natives of stagira) from \u0027σταγειρος\u0027 (stagira)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone from\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stagnation", "{\"term\":\"stagnation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027stagnatus\u0027 () past participle of \u0027stagno\u0027 (lang\u003dla) from \u0027stagnum\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"inactivit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The general concern about industrial \u0027\u0027stagnation\u0027\u0027 inspired an overhaul of the patent system\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"being stagnant; being without circulatio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Factors known to encourage the growth of harmful bacteria inside cooling systems include the \u0027\u0027stagnation\u0027\u0027 of the water\", \"priority\":4}]}, \"synonyms\":{}}");

	add("stahlian", "{\"term\":\"stahlian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Stahl|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A believer in, or advocate of, Stahlism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stain", "{\"term\":\"stain\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"old norse\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027steinen\u0027 \u0027steynen\u0027 (to stain, colour, paint) of origin, from Old norse {{m|non|steina||to stain, colour, paint}}, from \u0027steinn\u0027 (stone, mineral blee, colour, stain) from Proto-norse \u0027lang\u003dgmq-pro\u0027 from Proto-germanic {{m|gem-pro|*stainaz||stone}}, from Proto-indo-european {{m|ine-pro|*stAy-||stone}}. Cognate with Old english (ca. 450-1100) {{m|ang|stān||stone}}. More at {{l|en|stone}}.In some senses, influenced by unrelated Middle english (1100-1500) \u0027disteynen\u0027 (to discolor, remove the colour from\u0026quot;; literally, \u0026quot;de-colour) from Anglo-norman {{m|fro|desteindre||to remove the colour from, bleach}}, from Old french (842-ca. 1400) {{m|fro|destaindre||to remove the color from, bleach}}, from \u0027des-\u0027 (dis-, de-, un-) + {{m|fro|teindre||to dye}}, from Latin \u0027tingo\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A discoloured spot or area\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A blemish on one\u0027s character or reputation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A substance used to soak into a surface and colour it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A reagent or dye used to stain microscope specimens so as to make some structures visible\", \"priority\":4}]}, \"synonyms\":{}}");

	add("stainability", "{\"term\":\"stainability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stainable|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being stainable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stainer", "{\"term\":\"stainer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|stain}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that stains\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who stains or tarnishes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A workman who applies a stain to wood, etc\", \"priority\":3}]}, \"synonyms\":{}}");

	add("staines", "{\"term\":\"staines\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|stānas||stones}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A British town on the Thames\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stainless", "{\"term\":\"stainless\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stain|less|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Short for stainless steel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("staircase", "{\"term\":\"staircase\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"stair + case\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flight of stairs; a stairway\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A connected set of flights of stairs; a stairwell\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Turning back, then, toward the basement \u0027\u0027staircase\u0027\u0027, she began to grope her way through blinding darkness, but had taken only a few uncertain steps when, of a sudden, she stopped short and for a little stood like a stricken thing, quite motionless save that she quaked to her very marrow in the grasp of a great and enervating fear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d19|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dWhen Timothy and Julia hurried up the \u0027\u0027staircase\u0027\u0027 to the bedroom floor, where a considerable commotion was taking place, Tim took Barry Leach with him. He had him gripped firmly by the arm, since he felt it was not safe to let him loose, and he had no immediate idea what to do with him\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A set of locks (enclosed sections of waterway) mounted one above the next\", \"priority\":5}]}, \"synonyms\":{}}");

	add("stairfoot", "{\"term\":\"stairfoot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stair|foot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The foot, or bottom, of a flight of stairs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He blew out the lamp, and closed the \u0027\u0027stairfoot\u0027\u0027 door after him, as he slowly mounted the stairs behind her\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stairlift", "{\"term\":\"stairlift\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stair|lift|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A motorized platform installed in a stairway, which traverses the stairs when activated, for the benefit of those for whom the stairs are a barrier\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stairway", "{\"term\":\"stairway\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of steps allowing one to walk up or down comfortably\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d5|passage\u003dThen came a maid with hand-bag and shawls, and after her a tall young lady. She stood for a moment holding her skirt above the grimy steps, with something of the stately pose which Richter has given his Queen Louise on the \u0027\u0027stairway\", \"priority\":2}]}, \"synonyms\":{}}");

	add("staithe", "{\"term\":\"staithe\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old norse\"], \"text\":\"From Old english (ca. 450-1100) \u0027stæð\u0027 and/or Old norse \u0027stödh\u0027 (harbor)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A riverban\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fixed structure where ships land, especially to load and unload; wharf; landing stage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stakes", "{\"term\":\"stakes\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The money wagered in gambling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Risks\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stakhanovism", "{\"term\":\"stakhanovism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Stakhanov|ism|lang\u003den}}, from the name of w:Aleksei Grigorievich Stakhanov|Aleksei Grigor’evich Stakhanov (Алексе́й Григо́рьевич Стаха́нов), a Russian coal miner whose prodigious output was publicised by Stalin as part of a 1935 campaign.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system instituted in communist countries to encourage increased productivity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stakhanovite", "{\"term\":\"stakhanovite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Stakhanov|ite|lang\u003den}}, from the name of w:Aleksei Grigorievich Stakhanov|Aleksei Grigor’evich Stakhanov (Алексе́й Григо́рьевич Стаха́нов), a Russian coal miner whose prodigious output was publicised by Stalin as part of a 1935 campaign.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extremely productive or hard-working worker, especially in the former USSR, who may earn special rewards; a workaholic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Lewis H. Siegelbaum, \u0027Stakhanovism and the Politics of Productivity in the USSR, 1935-1941\u0027, [http://books.google.com.au/books?id\u003dtFO2JAuI1WkC\u0026amp;pg\u003dPA183\u0026amp;dq\u003d%22Stakhanovites%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmJ0tUd6gBqmPmQXP6oHQAw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Stakhanovites%22\u0026amp;f\u003dfalse page 183\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Nevertheless, few outstanding \u0027\u0027Stakhanovites\u0027\u0027 remained at the bench for very long. Even if they stayed on the enterprise payroll, they ceased to be workers, becoming instead living icons\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Stephan Merl, \u0027III: Social Mobility in the Countryside\u0027, William G. Rosenberg, Lewis H. Siegelbaum (editors), \u0027Social Dimensions of Soviet Industrialization\u0027, [http://books.google.com.au/books?id\u003dnbUJNOpfNn4C\u0026amp;pg\u003dPA56\u0026amp;dq\u003d%22Stakhanovites%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do4QtUZvMLbCemQWm24GoAw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Stakhanovites%22\u0026amp;f\u003dfalse page 56\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Kolkhozniki were soon attacking the \u0027\u0027Stakhanovites\u0027\u0027 with abandon, beating them up, destroying their animals, even killing them.\u0026lt;sup\u0026gt;40\u0026lt;/sup\u0026gt; For obvious reasons, collective farm management and even village authorities were often also not eager to see labor norms increased and colluded in these attacks\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Stephen Kotkin, \u0027Magnetic Mountain: Stalinism As a Civilization\u0027, [http://books.google.com.au/books?id\u003dQg6pZ01Eu_8C\u0026amp;pg\u003dPA500\u0026amp;dq\u003d%22Stakhanovites%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003do4QtUZvMLbCemQWm24GoAw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Stakhanovites%22\u0026amp;f\u003dfalse page 500\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In mid-1936, the steel plant\u0027s deputy director, Khazanov, revealed that according to factory administration data there were 3,663 \u0027\u0027Stackhanovites\u0027\u0027 at the steel plant, but according to the records of the trade union committee, there were 4,441. “In our shops,” he commented, “there are insufficiently precise criteria for determining \u0027\u0027Stakhanovites\u0027\u0027.”\", \"priority\":10}]}, \"synonyms\":{}}");

	add("stalactite", "{\"term\":\"stalactite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027stalactites\u0027 from Ancient greek (to 1453) \u0027σταλακτός\u0027 (dripping)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral deposit of calcium carbonate, in shapes similar to icicles, that hangs from the roof of a cave\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stalagmite", "{\"term\":\"stalagmite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027stalagmites\u0027 from Ancient greek (to 1453) \u0027στάλαγμα\u0027 (drop) or \u0027σταλαγμός\u0027 (dripping)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral deposit of calcium carbonate, in shapes similar to icicles, that lie on the ground of a cave\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stalinism", "{\"term\":\"stalinism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Communist philosophies espoused by Soviet Leader Josef Stalin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act or state of living in accord with the communist philosophies of Stalin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Totalitarianism, by extension from the rigid governing methods of Stalin\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stallion", "{\"term\":\"stallion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Proto-Germanic\"], \"text\":\"From Middle english (1100-1500) \u0027stalion\u0027 from Middle french (ca. 1400-1600) \u0027estalon\u0027 (hence modern French {{m|fr|étalon}}), of Proto-germanic origin, akin to {{m|en|stall}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male horse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Specifically, one that is uncastrated\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A male horse kept primarily as a stud\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A very virile, sexy or horny man\", \"priority\":4}]}, \"synonyms\":{}}");

	add("stamp", "{\"term\":\"stamp\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\", \"Occitan\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027stampen\u0027 (to pound, crush) from assumed Old english (ca. 450-1100) {{m|ang|*stampian}}, variant of Old english (ca. 450-1100) \u0027stempan\u0027 (to crush, pound, pound in mortar, stamp) from Proto-germanic {{m|gem-pro|*stampijaną||to trample, beat}}, from Proto-indo-european {{m|ine-pro|*stemb-||to trample down}}. Cognate with Dutch \u0027stampen\u0027 (to stamp, pitch) German \u0027stampfen\u0027 (to stamp) Danish \u0027stampe\u0027 (to stamp) Swedish \u0027stampa\u0027 (to stomp) Occitan \u0027estampar\u0027 See also {{l|en|stomp}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Stamp US 1847 5c-Benjamin right|thumb|The first U.S. stam\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act of stamping the foot, paw or hoof\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The horse gave two quick \u0027\u0027stamps\u0027\u0027 and rose up on its hind legs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Just then there was a sound of footsteps, and the Boy ran past near them, and with a \u0027\u0027stamp\u0027\u0027 of feet and a flash of white tails the two strange rabbits disappeared\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An indentation or imprint made by stamping\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"My passport has quite a collection of \u0027\u0027stamps\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A device for stamping designs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She loved to make designs with her collection of \u0027\u0027stamps\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A small piece of paper bearing a design on one side and adhesive on the other, used to decorate letters or craft work\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"These \u0027\u0027stamps\u0027\u0027 have a Christmas theme\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A small piece of paper, with a design and a face value, used to prepay postage postage or other costs such as tax or licence fees\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"I need one first-class \u0027\u0027stamp\u0027\u0027 to send this letter\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Now that commerce is done electronically, tax \u0027\u0027stamps\u0027\u0027 are no longer issued here\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A tatto\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A single dose of lysergic acid diethylamide\", \"priority\":15}]}, \"synonyms\":{}}");

	add("stamen", "{\"term\":\"stamen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|steh₂}}From Latin \u0027stamen\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In flowering plants, the structure in a flower that produces pollen, typically consisting of an anther and a filament\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stampede", "{\"term\":\"stampede\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish \u0027estampida\u0027 (a stampede) {{qualifier|in America}}, \u0027estampido\u0027 (a crackling) akin to \u0027estampar\u0027 (to stamp)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wild, headlong scamper, or run running away, of a number of animals; usually caused by fright; hence, any sudden flight or dispersion, as of a crowd or an army in consequence of a panic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She and her husband would join in the general \u0027\u0027stampede\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A situation in which many people in a crowd are trying to go in the same direction at the same time\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The annual Muslim Hajj in Mecca, Saudi Arabia, which is attended by millions of pilgrims, has increasingly suffered from \u0027\u0027stampedes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any sudden unconcerted moving or acting together of a number of persons, as from some common impulse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027stampede\u0027\u0027 toward US bonds in the credit markets\", \"priority\":6}]}, \"synonyms\":{}}");

	add("stamper", "{\"term\":\"stamper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who stamps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instrument for pounding or stamping\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A physical template from which many identical compact discs can be produced\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stance", "{\"term\":\"stance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"Via French from Italian \u0027stanza\u0027 (standing place) from Latin \u0027stāre\u0027 (to stand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The manner, posture, or pose in which one stands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fencer’s \u0027\u0027stance\u0027\u0027 showed he was ready to begin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One’s opinion or point of view\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I don’t agree with your \u0027\u0027stance\u0027\u0027 on gun control\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A station; a position; a site; a stopping place for buses at a bus statio\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A stanza\", \"priority\":6}]}, \"synonyms\":{}}");

	add("stanchion", "{\"term\":\"stanchion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027estanson\u0027 \u0027estanchon\u0027 (Modern French \u0027étançon\u0027 , from \u0027estance\u0027 (a stay, a prop) from Latin \u0027stans\u0027 (standing) present participle of \u0027stō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Stanchions and velvet rope - 37th G8 summit in Deauville thumb|Stanchions supporting velvet rop\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vertical pole, post, or support\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, w:J. M. J. M. Coetzee, \u0027w:The Childhood of The Childhood of Jesus\u0027. Melbourne, Australia: The Text Publishing Company. chapter 27. p. 268\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He staggers against a \u0027\u0027stanchion\u0027\u0027, trips over a rope, and tumbles into the space between the quay and the steel plates of the freighter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A framework of such posts, used to secure or confine cattle\", \"priority\":5}]}, \"synonyms\":{}}");

	add("standardista", "{\"term\":\"standardista\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|standard|ista|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A web developer who is actively involved in the creation, adoption, and/or promotion of web standards\", \"priority\":1}]}, \"synonyms\":{}}");

	add("standardization", "{\"term\":\"standardization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|standardize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of complying (or evaluate by comparing) with a standard\u0026lt;!-- , of adapting so all are similar--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of establishing a standard\", \"priority\":2}]}, \"synonyms\":{}}");

	add("standby", "{\"term\":\"standby\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"State of readiness without being immediately involved\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The troops were on \u0027\u0027standby\u0027\u0027 in case of an attack\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Waiting at the airport in the hope of getting a seat on a flight that is already booked out\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something that is standard, well-tested, or frequently used\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That recipe is an old \u0027\u0027standby\u0027\u0027, and she keeps the ingredients around in case of unexpected guests\", \"priority\":5}]}, \"synonyms\":{}}");

	add("standee", "{\"term\":\"standee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|lang\u003den|stand|ee}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Somebody who is forced to stand, for example on a crowded bus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A life-size shape, for instance of a celebrity, cut out of cardboard, often used for advertising and promotional purposes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He took a picture of me with a \u0027\u0027standee\u0027\u0027 of Darth Vader at the premiere of Episode 3\", \"priority\":3}]}, \"synonyms\":{}}");

	add("standergrass", "{\"term\":\"standergrass\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant (\u0027Orchis mascula\", \"priority\":1}]}, \"synonyms\":{}}");

	add("standoff", "{\"term\":\"standoff\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stand|off|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device which maintains a fixed distance between two objects, especially between a surface and a sign or electrical wiring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Wikipedia, \u0027:w:Insulator Insulator (electricity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Feedlines attaching antennas to radio equipment, particularly twin lead type, often must be kept at a distance from metal structures. The insulated supports used for this purpose are called \u0027\u0027standoff\u0027\u0027 insulators\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A deadlocked confrontation between antagonists (see stand off and\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"verb below\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I don\u0027t want to get involved in the \u0027\u0027standoff\u0027\u0027 between those two\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A tense \u0027\u0027standoff\u0027\u0027 between demonstrators and police continued overnight\", \"priority\":7}]}, \"synonyms\":{}}");

	add("standoffishness", "{\"term\":\"standoffishness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state, quality, or condition of being standoffish or aloof and unsociable; aloofness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("standpoint", "{\"term\":\"standpoint\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"Japanese\"], \"text\":\"{{compound|stand|point|lang\u003den}}, a calque of German \u0027standpunkt\u0027 Similar constructions used in other languages, such as Japanese \u0027立場\u0027 meaning \u0027standing place\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"point of Point of view; perspectiv\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bathing once a month may save time, but from a cleanliness \u0027\u0027standpoint\u0027\u0027, it\u0027s not effective\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stanford", "{\"term\":\"stanford\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Various place names from Old english (ca. 450-1100) \u0027stān\u0027 (stone) + \u0027ford\u0027 (ford)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A private university in the Bay Area of California\", \"priority\":2}]}, \"synonyms\":{}}");

	add("staniel", "{\"term\":\"staniel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027staniel\u0027 (bird of prey) from Old english (ca. 450-1100) {{m|ang|stānġiella||staniel, pelican\u0026quot;; literally, \u0026quot;rock-crier}}, from {{m|ang|stān||stone, rock}} + {{m|ang|ġiella||yeller, crier}}. More at {{l|en|stone}}, {{l|en|yell}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The kestrel or windhover\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stanley", "{\"term\":\"stanley\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From places in England, Old english (ca. 450-1100) {{m|ang|stān||stone}} + {{m|ang|lēah||meadow}}.* The given name has also been used as a anglicisation of Stanisław, Stanislav and related names.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several places, outside England named for persons with the surname\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname. Popular in early 20th century\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stannylium", "{\"term\":\"stannylium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stannyl|ium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any cation formed by a tin atom with three bonds, having the general formula R\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;Sn\u0026lt;sup\u0026gt;+\u0026lt;/sup\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stanozolol", "{\"term\":\"stanozolol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A synthetic anabolic steroid derived from testosterone, chemical formula C\u0026lt;sub\u0026gt;21\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;32\u0026lt;/sub\u0026gt;N\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;O\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stanza", "{\"term\":\"stanza\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027stanza\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of a poem, written or printed as a paragraph; equivalent to a verse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An apartment or division in a building.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An XML element which acts as basic unit of meaning in XMPP\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, P. Saint-Andre, \u0027RFC 6120 - Extensible Messaging and Presence Protocol (XMPP): Core\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Definition of XML \u0027\u0027Stanza\u0027\u0027: An XML \u0027\u0027stanza\u0027\u0027 is the basic unit of meaning in XMPP\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Tim Riley, Adam Goucher, \u0027Beautiful Testing: Leading Professionals Reveal How They Improve Software\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Whenever an XMPP client generates an XML \u0027\u0027stanza\u0027\u0027, it typically constructs the XML of the stanza by building up a structured document\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, John Rittinghouse, James F. Ransome, \u0027Cloud Computing: Implementation, Management, and Security\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Technically speaking, federation is the ability for two XMPP servers in different domains to exchange XML \u0027\u0027stanzas\", \"priority\":9}]}, \"synonyms\":{}}");

	add("stapes", "{\"term\":\"stapes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027stapēs\u0027 (stirrup)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small stirrup-shaped bone of the middle ear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Elaine N. Marieb \u0026amp; Katja Hoehn, \u0027Human Anatomy \u0026amp; Physiology\u0027, 8th edition, page 57\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The tympanic cavity is spanned by the three smallest bones in the body: the auditory ossicles These bones, named for their shape, are the malleus (malʹe-us; \u0026quot;hammer\u0026quot;); the incus (ingʹkus; \u0026quot;anvil\u0026quot;); and the \u0027\u0027stapes\u0027\u0027 (staʹpēz; \u0026quot;stirrup\u0026quot;). The \u0026quot;handle\u0026quot; of the malleus is secured to the eardrum, and the base of the \u0027\u0027stapes\u0027\u0027 fits into the oval window\", \"priority\":3}]}, \"synonyms\":{}}");

	add("staphylococcus", "{\"term\":\"staphylococcus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027staphylo\u0027 (Ancient greek (to 1453) \u0027σταφυλή\u0027 + \u0027coccus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spherical gram-positive parasitic bacterium of the genus \u0027Staphylococcus\u0027, causing blisters, septicemia, and other infections\", \"priority\":1}]}, \"synonyms\":{}}");

	add("staphyloxanthin", "{\"term\":\"staphyloxanthin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|staphylo|xanthin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A carotenoid pigment produced by some strains of \u0027Staphylococcus aureus\u0027, which acts as a virulence factor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stars", "{\"term\":\"stars\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"outer Outer space\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starboard", "{\"term\":\"starboard\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) \u0027sterbord\u0027 from Old english (ca. 450-1100) {{compound|stēor|bord|gloss1\u003dsteer|gloss2\u003dside (of a ship)|lang\u003dang|nocat\u003d1}}. Ships had to dock on their left (port) side because the steering oar on the right would get in the way, which is how the left became known as the port side.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The right hand side of a ship, boat or aircraft when facing the front, or fore or bow. Starboard does not change based on the orientation of the person aboard the craft\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the two traditional watches aboard a ship standing a watch in two\", \"priority\":2}]}, \"synonyms\":{}}");

	add("starburst", "{\"term\":\"starburst\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|burst|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violent explosion, or the pattern (likened to the shape of a star) supposed to be made by such an explosion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027: Ellen Datlow, Terri Windling, \u0027The Year\u0027s Best Fantasy \u0026amp; Horror\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"his arm striking brick and the bottle shattering in a \u0027\u0027starburst\u0027\u0027 of black\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: Tim Cockey, \u0027Murder in the Hearse Degree: A Novel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027starburst\u0027\u0027 of red exploded on his chest and he flew backward a good six or seven feet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: Elizabeth George, \u0027Write Away: One Novelist\u0027s Approach to Fiction and the Writing Life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"and another that creates a cicatrix \u0027\u0027starburst\u0027\u0027 from her right eye to her temple. This scar is the result of an accident when she was ten years old\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A symbol similar to an asterisk, but with additional rays: \u0026lt;font size\u003d6\u0026gt;✺\u0026lt;/font\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A region of space with an unusually high rate of star formation\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A period in time during which a region of space experiences an unusually high rate of star formation\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the Milky Way will see a \u0027\u0027starburst\u0027\u0027 in approximately 200\u0026amp;nbsp;000\u0026amp;nbsp;000 years\", \"priority\":11}]}, \"synonyms\":{}}");

	add("staredown", "{\"term\":\"staredown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stare|down|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A confrontation in which each party waits for the other to yiel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("staree", "{\"term\":\"staree\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stare|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is stared at\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Jay Ingram, \u0027The Velocity of Honey and More Science of Everyday Life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"So at first the starer sat right behind the \u0027\u0027staree\u0027\u0027; then the starer sat behind a one-way mirror, to eliminate the possibility of subtle sound clues created when the starer looked either at or away from the staree\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starfish", "{\"term\":\"starfish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"star + fish\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various asteroids or other echinoderms (not in fact fish) with usually five arms, many of which eat bivalves or corals by everting their stomach\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an anus. See also chocolate starfish\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any many-armed or tentacled sea invertebrate, whether cnidarian, echinoderm, or cephalopod\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1755\u0027\u0027, w:Erik Erik Pontoppidan, trans. Isaac Kimbler, \u0027Explanation of the Plate of Uncommon Star Fish, Extracted from the Natural History of Norway\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But the largest of the \u0027\u0027star-fish\u0027\u0027 kind is that sea monster called kruken, kraken or krabben. [...] As this enormous sea-animal in all probability may be reckoned of the polype, or of the \u0027\u0027star-fish\u0027\u0027, kind, it seems that the parts which are seen rising at its pleasure, and are called arms, are properly the tentacula, or feeding instruments, called horns as well as arms\", \"priority\":5}]}, \"synonyms\":{}}");

	add("starflower", "{\"term\":\"starflower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|flower|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several annual herbs, of the genus , having white star-shaped leaves\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stargazer", "{\"term\":\"stargazer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|star|gazer|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who stargazes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A perciform fish in the family\", \"priority\":2}]}, \"synonyms\":{}}");

	add("starhood", "{\"term\":\"starhood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|star|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a star (whether an astronomic object or a celebrity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Tom Siegfried, \u0027Strange Matters: Undiscovered Ideas at the Frontiers of Space and Time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Brown dwarfs are much bigger than planets but not quite big enough to generate the internal pressure needed to burst into \u0027\u0027starhood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Mark Littmann, Fred Espenak and Ken Willcox, \u0027Totality: Eclipses of the Sun\u0027, page 28\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Near those stars-to-be, other bodies, too low in mass ever to reach \u0027\u0027starhood\u0027\u0027, also began to form\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Peter Benjaminson, \u0027The Lost Supreme: The Life of Dreamgirl Florence Ballard\u0027, page 16\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It was the only image of the funeral most people saw, making the occasion an emblem of Diana\u0027s \u0027\u0027starhood\u0027\u0027 rather than a celebration of Florence\u0027s life and a scene of mourning for her death\", \"priority\":7}]}, \"synonyms\":{}}");

	add("starkeyite", "{\"term\":\"starkeyite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Starkey|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monoclinic-prismatic white mineral containing hydrogen, magnesium, oxygen, and sulfur\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starlet", "{\"term\":\"starlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|star|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A young actress with a promising career ahead of her\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Christoper Zara, \u0027Tortured Artists: From Picasso and Monroe to Warhol and Winehouse, the Twisted Secrets of the World\u0027s Most Creative Minds\u0027, part 1, chapter 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There were other flapper-era \u0027\u0027starlets\u0027\u0027, of course—Louise Brooks, Greta Garbo—but they were poseurs by comparison\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starlight", "{\"term\":\"starlight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|light|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Light emitted from stars other than the Su\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nor walk by moon, / Or glittering \u0027\u0027starlight\u0027\u0027, without thee is sweet\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starling", "{\"term\":\"starling\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027stærlinc\u0027 from \u0027stær\u0027 (lang\u003dang) + \u0027-linc\u0027 (lang\u003dang)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A family, Sturnidae, of passerine birds\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The common starling, \u0027Sturnus vulgaris\u0027, which has dark, iridescent plumage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A structure of pilings that protects the piers of a bridge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A California fish, the , especially, the or . \u0026lt;!--Webster 1913/Century--\u0026gt\", \"priority\":4}]}, \"synonyms\":{}}");

	add("starnie", "{\"term\":\"starnie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|starn|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small star\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starquake", "{\"term\":\"starquake\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|star|earthquake|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violent tremor or quake that occurs on or near the surface of a star, especially a collapsed star\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Paul Murdin, Lesley Murdin, \u0027New Astronomy\u0027, [http://books.google.com.au/books?id\u003d2zTnw4fR17YC\u0026amp;pg\u003dPA131\u0026amp;dq\u003d%22starquake%22%7C%22starquakes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djNzOUdTUGMaKiQed84HIBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22starquake%22%7C%22starquakes%22\u0026amp;f\u003dfalse page 131\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Astronomers call the sudden changes in the neutron star \u0027\u0027\u0027starquakes\u0027\u0027\u0027. The energy released in a \u0027\u0027starquake\u0027\u0027 is enormous and flows out from the star into the space surrounding it. After the 1969 \u0027\u0027starquake\u0027\u0027 on the Crab pulsar, a wave of energy was seen to flow outwards, rippling through the centre of the Crab Nebula\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Richard I. Epstein, Bennett Link, \u0027\u0027\u0027Starquake\u0027\u0027-Induced Glitches in Pulsars\u0027, Kwong-Sang Cheng H, F, Chau, K. L. Chan, K. C. Leung (editors), \u0027Stellar Astrophysics: Proceedings of the Pacific Rim Conference\u0027, [http://books.google.com.au/books?id\u003dWqBD5Yn89SgC\u0026amp;pg\u003dPA96\u0026amp;dq\u003d%22starquake%22%7C%22starquakes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djNzOUdTUGMaKiQed84HIBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22starquake%22%7C%22starquakes%22\u0026amp;f\u003dfalse page 96\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Starquakes\u0027\u0027 in slowing neutron stars drive matter toward the magnetic poles, distort the star\u0027s shape, and excite precession\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Carl Carl Sagan, Jerome Agel, \u0027Carl Sagan\u0027s Cosmic Connection: An Extraterrestrial Perspective\u0027 [new edition of 1973, \u0027The Cosmic Connection\u0027], [http://books.google.com.au/books?id\u003dlL57o9YB0mAC\u0026amp;pg\u003dPA260\u0026amp;dq\u003d%22starquake%22%7C%22starquakes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003djNzOUdTUGMaKiQed84HIBg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22starquake%22%7C%22starquakes%22\u0026amp;f\u003dfalse page 260\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Should the core be solid, \u0027\u0027starquakes\u0027\u0027 are expected — a shifting of the matter under enormous stress in the interior of the star. Such \u0027\u0027starquakes\u0027\u0027 should produce a discontinuous change in the period of rotation of the neutron star. Such changes, called \u0026quot;glitches,\u0026quot; are observed\", \"priority\":10}]}, \"synonyms\":{}}");

	add("starshine", "{\"term\":\"starshine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|shine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"starligh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Robert Louis Stevenso\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027starshine\u0027\u0027 lights upon our heads\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starstuff", "{\"term\":\"starstuff\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"Dutch\"], \"text\":\"From {{compound|star|stuff|lang\u003den}}. Compare Dutch \u0027sterrenstof\u0027 (stardust) German \u0027sternenstoff\u0027 (star matter)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The material composition of stars; matter originated from stars; starmatter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Thom Hartmann, \u0027The Last Hours of Ancient Sunlight\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Not only is the matter around you \u0027\u0027star-stuff\u0027\u0027, but you are, too. There is not a single cell in your body that is not made of matter formed in the heart, and then the death, of a distant and now-extinct star\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Michael Dowd, \u0027Thank God for Evolution\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;[...] We have begun to contemplate our origins—\u0027\u0027starstuff\u0027\u0027 pondering the stars!”\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, David Waite Yohn, \u0027Energy: Lifestyle For Today\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Energy takes \u0027\u0027starstuff\u0027\u0027 and turns it into a horse. Dissolves the horse back into stardust and uses the same \u0027\u0027starstuff\u0027\u0027 to grow a tree\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Dave Barry, \u0027Peter and the Sword of Mercy\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“The Cache,” said Leonard. “A large quantity of \u0027\u0027starstuff\u0027\u0027, hidden here in London centuries ago.” “Hidden by whom?” “By the original Starcatchers,” said Leonard\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, K. F. Long, \u0027Deep Space Propulsion: A Roadmap to Interstellar Flight\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Others have discussed this idea, such as the physicist Greg Matloff, who states: In one of his books, the late Carl Sagan states that we are all \u0027\u0027starstuff\u0027\u0027,\u0027 since the atoms that compose us were mostly generated in the explosive demise of a super giant star\", \"priority\":11}]}, \"synonyms\":{}}");

	add("startbox", "{\"term\":\"startbox\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|start|box|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The compartment of a maze etc. into which the animal subject in a psychology experiment is initially placed\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starter", "{\"term\":\"starter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|start|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who starts something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027starter\u0027\u0027 on a journey\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The person who starts a race by firing a gun or waving a fla\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A starting pitcher\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something that starts something\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s small, but it\u0027s a good \u0027\u0027starter\u0027\u0027 house\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An electric motor that starts an internal combustion engin\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A device that initiates the flow of high voltage electricity in a fluorescent lam\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A yeast culture used to start a fermentation proces\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The first course of a meal, consisting of a small, usually savoury, dish\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A player in the lineup of players that a team fields at the beginning of a game\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A dog that rouses game\", \"priority\":12}]}, \"synonyms\":{}}");

	add("startler", "{\"term\":\"startler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|startle|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, startles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("starvation", "{\"term\":\"starvation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{affix|en|starve|-ation}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a condition of severe suffering due to a lack of nutrition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, w:The Land That Time Forgot The Land That Time Forgot Chapter I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;We haven\u0027t one chance for life in a hundred thousand if we don\u0027t find food and water upon Caprona. This water coming out of the cliff is not salt; but neither is it fit to drink, though each of us has drunk. It is fair to assume that inland the river is fed by pure streams, that there are fruits and herbs and game. Shall we lie out here and die of thirst and \u0027\u0027starvation\u0027\u0027 with a land of plenty possibly only a few hundred yards away? We have the means for navigating a subterranean river. Are we too cowardly to utilize this means?\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starveling", "{\"term\":\"starveling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|starve|ling|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is thin from lack of food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1597\u0027\u0027, w:William William Shakespeare, \u0027Henry IV Part I\u0027, act 2, sc. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If I hang, I\u0027ll make a fat pair of gallows; for if I hang, old Sir John hangs with me, and thou knowest he is no \u0027\u0027starveling\", \"priority\":3}]}, \"synonyms\":{}}");

	add("starwort", "{\"term\":\"starwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|star|wort|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several unrelated plants that have a star-shaped flowers or leaves, but especially members of the genus \u0027Stellaria\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stash", "{\"term\":\"stash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection, sometimes hidden; a reserve\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They had quite a \u0027\u0027stash\u0027\u0027 of food saved up for emergencies\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stasher", "{\"term\":\"stasher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"agent Agent noun of stas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"stash; one who stashes\", \"priority\":2}]}, \"synonyms\":{}}");

	add("stasis", "{\"term\":\"stasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{PIE root|en|steh₂}}From from Ancient greek (to 1453) \u0027στάσις\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slackening or arrest of the blood current, due not to a lessening of the heart’s beat, but to some abnormal resistance of the capillary walls\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Inactivity; a freezing, or state of motionlessness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His company was sized for growth, not \u0027\u0027stasis\", \"priority\":3}]}, \"synonyms\":{}}");

	add("state", "{\"term\":\"state\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"{{PIE root|en|steh₂}}From Old french (842-ca. 1400) \u0027estat\u0027 from Latin \u0027status\u0027 (manner of standing, attitude, position, carriage, manner, dress, apparel; and other senses) from \u0027stare\u0027 (to stand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any sovereign polity; a government\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"20C\u0027\u0027, as quoted by Virgil Henshaw in \u0027Albert Einstein: Philosopher Scientist\u0027 (1949\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Never do anything against conscience even if the \u0027\u0027state\u0027\u0027 demands it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/18/falling-upwards-richard-holmes-review Fantasy of passage\u003dIt is tempting to speculate about the incentives or compulsions that might explain why anyone would take to the skies in [the] basket [of a balloon]:\u0026amp;nbsp;[\u0026amp;hellip;]; \u0026amp;nbsp;[\u0026amp;hellip;]; or perhaps to muse on the irrelevance of the borders that separate nation \u0027\u0027states\u0027\u0027 and keep people from understanding their shared environment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A political division of a federation retaining a degree of autonomy, for example one of the fifty United States. See also Province\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A form of government other than a monarchy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1631-1700\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Well monarchies may own religion\u0027s name, / But \u0027\u0027states\u0027\u0027 are atheists in their very fame\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A society larger than a tribe. A society large enough to form a state in the sense of a government\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A condition; a set of circumstances applying at any given time\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1631-1700\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Declare the past and present \u0027\u0027state\u0027\u0027 of things\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dI corralled the judge, and we started off across the fields, in no very mild \u0027\u0027state\u0027\u0027 of fear of that gentleman\u0027s wife, whose vigilance was seldom relaxed\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The stable condition of a processor during a particular clock cycle\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The set of all parameters relevant to a computation\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The values of all parameters at some point in a computation\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The physical property of matter as solid, liquid, gas or plasma\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Highest and stationary condition, as that of maturity between growth and decline, or as that of crisis between the increase and the abating of a disease; height; acme\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"High social standing or circumstance\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Pomp, ceremony, or dignity\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Rank; condition; quality\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Thy honour, \u0027\u0027state\u0027\u0027, and seat is due to me\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Condition of prosperity or grandeur; wealthy or prosperous circumstances; social importance\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"1561-1626\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"She instructed him how he should keep \u0027\u0027state\u0027\u0027, and yet with a modest sense of his misfortunes\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"1688-1744\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"Can this imperious lord forget to reign, / Quit all his \u0027\u0027state\u0027\u0027, descend, and serve again\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A chair with a canopy above it, often standing on a dais; a seat of dignity; also, the canopy itself\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"His high throne,under \u0027\u0027state\u0027\u0027 / Of richest texture spread\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"1667–1745\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"When he went to court, he used to kick away the \u0027\u0027state\u0027\u0027, and sit down by his prince cheek by jowl\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"A great person, a dignitary; a lord or prince\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"They who to \u0027\u0027States\u0027\u0027 and Governours of the Commonwealth direct their Speech; I suppose them as at the beginning of no meane endeavour, not a little alter\u0027d and mov\u0027d inwardly in their mindes\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"Estate, possession\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"1583-1640\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"Your \u0027\u0027state\u0027\u0027, my lord, again is yours\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"An element of the range of the random variables that define a random process\", \"priority\":40}]}, \"synonyms\":{}}");

