	add("static", "{\"term\":\"static\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{PIE root|en|steh₂}}Modern Latin \u0027staticus\u0027 from Ancient greek (to 1453) \u0027στατικός\u0027 from \u0027ἱστάναι\u0027 (to make stand)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Interference on a broadcast signal caused by atmospheric disturbances; heard as crackles on radio, or seen as random specks on television\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Interference or obstruction from people\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something that is not part of any perceived universe phenomena; having no motion; no particle; no wavelength\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"static Static electricity\", \"priority\":4}]}, \"synonyms\":{}}");

