	add("station", "{\"term\":\"station\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\", \"anglo-norman\"], \"text\":\"{{PIE root|en|steh₂}}From Middle english (1100-1500) {{m|enm|estacioun}}, from Anglo-norman \u0027estation\u0027 () from Latin {{m|la|statiōnem}}, accusative of \u0027statiō\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Steinsrud thumb|right|a train \u0027\u0027station\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fact of standing still; motionlessness, stasis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, Sir , \u0027\u0027, III.5\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the cross legs [are] moving or resting together, so that two are always in motion and two in \u0027\u0027station\u0027\u0027 at the same tim\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The apparent standing still of a superior planet just before it begins or ends its retrograde motion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A stopping place\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A regular stopping place for ground transportation\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A ground transportation depot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A place where one stands or stays or is assigned to stand or stay\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"quot;Meanwhile, lest anything should really be amiss, or any malefactor seek to escape by the back, you and the boy must go round the corner with a pair of good sticks and take your post at the laboratory door. We give you ten minutes, to get to your \u0027\u0027stations\u0027\u0027.\u0026quot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1519647W “Piracy”: A Romantic Chronicle of These chapter\u003dEp./1/2|passage\u003dHe walked. To the corner of Hamilton Place and Picadilly, and there stayed for a while, for it is a romantic \u0027\u0027station\u0027\u0027 by night. The vague and careless rain looked like threads of gossamer silver passing across the light of the arc-lamps\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A gas station, service station\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 October 31, David M. Halbfinger, \u0026quot;[http://www.nytimes.com/2012/11/01/nyregion/new-jersey-continues-to-cope-with-hurricane-sandy.html?hp],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 31 October 2012)\u0026lt;/small\u0026gt\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Localities across New Jersey imposed curfews to prevent looting. In Monmouth, Ocean and other counties, people waited for hours for gasoline at the few \u0027\u0027stations\u0027\u0027 that had electricity. Supermarket shelves were stripped bare\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A place where workers are stationed\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"An official building from which police or firefighters operate\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A place where one performs a task or where one is on call to perform a task\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A military base\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A place used for broadcasting radio or television\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A very large sheep or cattle farm\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, w:Banjo A. B. Paterson, \u0027s:The Man From Snowy The Man From Snowy River\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"There was movement at the \u0027\u0027station\u0027\u0027, for the word had passed around, / that the colt from old Regret had got away\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Kay Walsh, Joy W. Hooton, \u0027Dowker, L. O.\u0027, entry in \u0027Australian Autobiographical Narratives: 1850-1900\u0027, %22stations%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d_wyTYjQ8eo\u0026amp;sig\u003dN1T04h53D04yrOVvh-Edt0u_wfU\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFZBlUIGKOe-4iAeV14CICg\u0026amp;redir_esc\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"%22stations%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 69\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Tiring of sheep, he took work on cattle \u0027\u0027stations\u0027\u0027, mustering cattle on vast unfenced holdings, and looking for work ‘nigger-bossing’, or supervising Aboriginal \u0027\u0027station\u0027\u0027 hands\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Margo Daly, Anne Dehne, \u0027Rough Guide to Australia\u0027, %22stations%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003do34hDLhGX2\u0026amp;sig\u003dH1VE3zO5MPiE8GN5KHiRRHksl9E\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFZBlUIGKOe-4iAeV14CICg\u0026amp;redir_esc\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"%22stations%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 654\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"The romance of the gritty \u0027\u0027station\u0027\u0027 owner in a crumpled Akubra, his kids educated from the remote homestead by the School of the Air, while triple-trailer road trains drag tornadoes of dust across the plains, creates a stirring idea of the modern-day pioneer battling against the elemental Outback\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"One of the Stations of the Cross\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"The Roman Catholic fast of the fourth and sixth days of the week, Wednesday and Friday, in memory of the council which condemned Christ, and of his passion\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A church in which the procession of the clergy halts on stated days to say stated prayers\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Standing; rank; position\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"The greater part have kept, I see, / Their \u0027\u0027station\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"they in France of the best rank and \u0027\u0027station\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"A broadcasting entity\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"A harbour or cove with a foreshore suitable for a facility to support nearby fishing\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"Any of a sequence of equally spaced points along a path\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"The particular place, or kind of situation, in which a species naturally occurs; a habitat\", \"priority\":40},{\"upperType\":\"NOUN\", \"text\":\"An enlargement in a shaft or galley, used as a landing, or passing place, or for the accommodation of a pump, tank, etc\", \"priority\":41},{\"upperType\":\"NOUN\", \"text\":\"Post assigned; office; the part or department of public duty which a person is appointed to perform; sphere of duty or occupation; employment\", \"priority\":42},{\"upperType\":\"NOUN\", \"text\":\"1656-1715\", \"priority\":43},{\"upperType\":\"NOUN\", \"text\":\"By spending this day [Sunday] in religious exercises, we acquire new strength and resolution to perform God\u0027s will in our several \u0027\u0027stations\u0027\u0027 the week following\", \"priority\":44}]}, \"synonyms\":{\"list\":[{\"text\":\"sta\", \"synonymQualifier\":\"ABBREVIATION\"}]}}");

