	add("statism", "{\"term\":\"statism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|state|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that the centralization of power in a state (sovereign polity) is the ideal or best way to organize humanity\", \"priority\":1}]}, \"synonyms\":{}}");

