	add("statue", "{\"term\":\"statue\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027statue\u0027 from Latin \u0027statua\u0027 derived from \u0027statuō\u0027 (set up or erect)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A three-dimensional work of art, usually representing a person or animal, usually created by sculpting, carving, molding, or casting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I will raise her \u0027\u0027statue\u0027\u0027 in pure gold\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A portrait\", \"priority\":4}]}, \"synonyms\":{}}");

